import React, { useState } from 'react';

const Mockup = () => {
  const [selectedFloor, setSelectedFloor] = useState('/assets/marble-floor-2.jpg');

  const floorOptions = [
    {
      id: 'marble1',
      name: 'Marble Classic',
      image: '/assets/marble-floor-2.jpg'
    },
    {
      id: 'marble2', 
      name: 'Marble Modern',
      image: '/assets/marble-floor-2.png'
    },
    {
      id: 'marble3',
      name: 'Marble Luxury', 
      image: '/assets/marblefloor3.jpg'
    },
    {
      id: 'special',
      name: 'Special Pattern',
      image: '/assets/awfgazdgh.png'
    }
  ];

  const liftStyle = {
    width: '400px',
    height: '500px',
    margin: '20px auto',
    position: 'relative',
    background: 'linear-gradient(145deg, #e6e6e6, #ffffff)',
    borderRadius: '15px',
    boxShadow: '20px 20px 40px #d1d1d1, -20px -20px 40px #ffffff',
    overflow: 'hidden'
  };

  const liftInteriorStyle = {
    width: '360px',
    height: '460px',
    margin: '20px',
    position: 'relative',
    background: 'linear-gradient(145deg, #f0f0f0, #e1e1e1)',
    borderRadius: '10px',
    boxShadow: 'inset 8px 8px 15px #d1d1d1, inset -8px -8px 15px #ffffff'
  };

  const backWallStyle = {
    position: 'absolute',
    top: '0',
    left: '0',
    right: '0',
    height: '350px',
    background: 'linear-gradient(180deg, #f5f5f5 0%, #e8e8e8 50%, #ddd 100%)',
    borderRadius: '10px 10px 0 0'
  };

  const leftWallStyle = {
    position: 'absolute',
    top: '0',
    left: '0',
    width: '60px',
    height: '350px',
    background: 'linear-gradient(90deg, #e0e0e0, #f0f0f0)',
    borderRadius: '10px 0 0 0'
  };

  const rightWallStyle = {
    position: 'absolute',
    top: '0',
    right: '0',
    width: '60px', 
    height: '350px',
    background: 'linear-gradient(-90deg, #e0e0e0, #f0f0f0)',
    borderRadius: '0 10px 0 0'
  };

  const floorStyle = {
    position: 'absolute',
    bottom: '0',
    left: '0',
    right: '0',
    height: '110px',
    backgroundImage: `url(${selectedFloor})`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    borderRadius: '0 0 10px 10px',
    boxShadow: 'inset 0 5px 15px rgba(0,0,0,0.3)'
  };

  const ceilingStyle = {
    position: 'absolute',
    top: '10px',
    left: '10px',
    right: '10px',
    height: '30px',
    background: 'linear-gradient(145deg, #f8f8f8, #e0e0e0)',
    borderRadius: '8px',
    boxShadow: '2px 2px 8px rgba(0,0,0,0.1)'
  };

  const lightStyle = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    width: '80px',
    height: '15px',
    background: 'linear-gradient(90deg, #fff, #f0f0f0)',
    borderRadius: '20px',
    boxShadow: '0 0 20px rgba(255,255,255,0.8), inset 2px 2px 4px rgba(0,0,0,0.1)'
  };

  const controlPanelStyle = {
    position: 'absolute',
    top: '80px',
    right: '15px',
    width: '35px',
    height: '120px',
    background: 'linear-gradient(145deg, #2c2c2c, #1a1a1a)',
    borderRadius: '8px',
    boxShadow: '3px 3px 8px rgba(0,0,0,0.3)',
    display: 'flex',
    flexDirection: 'column',
    justifyContent: 'space-around',
    alignItems: 'center',
    padding: '5px'
  };

  const buttonStyle = {
    width: '20px',
    height: '20px',
    borderRadius: '50%',
    background: 'radial-gradient(circle, #4a4a4a, #2a2a2a)',
    border: '2px solid #333',
    boxShadow: '1px 1px 3px rgba(0,0,0,0.5)',
    fontSize: '8px',
    color: '#888',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center'
  };

  const selectorStyle = {
    display: 'flex',
    justifyContent: 'center',
    gap: '15px',
    marginTop: '30px',
    flexWrap: 'wrap'
  };

  const optionStyle = {
    padding: '10px 15px',
    borderRadius: '8px',
    border: '2px solid #ddd',
    background: 'white',
    cursor: 'pointer',
    transition: 'all 0.3s ease',
    textAlign: 'center',
    minWidth: '120px'
  };

  const selectedOptionStyle = {
    ...optionStyle,
    border: '2px solid #007bff',
    background: '#e7f3ff',
    transform: 'scale(1.05)'
  };

  const previewStyle = {
    width: '40px',
    height: '40px',
    borderRadius: '4px',
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    margin: '0 auto 8px',
    border: '2px solid #eee'
  };

  return (
    <div style={{ 
      padding: '20px', 
      fontFamily: 'Arial, sans-serif',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      minHeight: '100vh'
    }}>
      <h2 style={{ 
        textAlign: 'center', 
        color: 'white',
        marginBottom: '30px',
        fontSize: '28px',
        textShadow: '2px 2px 4px rgba(0,0,0,0.3)'
      }}>
        Lift Floor Customizer
      </h2>

      {/* Lift Structure */}
      <div style={liftStyle}>
        <div style={liftInteriorStyle}>
          {/* Ceiling */}
          <div style={ceilingStyle}>
            <div style={lightStyle}></div>
          </div>

          {/* Walls */}
          <div style={backWallStyle}></div>
          <div style={leftWallStyle}></div>
          <div style={rightWallStyle}></div>

          {/* Control Panel */}
          <div style={controlPanelStyle}>
            <div style={buttonStyle}>2</div>
            <div style={buttonStyle}>1</div>
            <div style={buttonStyle}>G</div>
            <div style={buttonStyle}>B</div>
          </div>

          {/* Floor (Changeable) */}
          <div style={floorStyle}></div>
        </div>
      </div>

      {/* Floor Selection */}
      <div style={selectorStyle}>
        {floorOptions.map((floor) => (
          <div
            key={floor.id}
            style={selectedFloor === floor.image ? selectedOptionStyle : optionStyle}
            onClick={() => setSelectedFloor(floor.image)}
          >
            <div 
              style={{
                ...previewStyle,
                backgroundImage: `url(${floor.image})`
              }}
            ></div>
            <div style={{ fontSize: '12px', fontWeight: 'bold' }}>
              {floor.name}
            </div>
          </div>
        ))}
      </div>

      <div style={{
        textAlign: 'center',
        marginTop: '20px',
        color: 'white',
        fontSize: '14px'
      }}>
        Click on a floor style to see it applied to the lift
      </div>
    </div>
  );
};

export default Mockup;
